import classes from "./FightItem.module.css";
import Card from "../ui/Card";
import axios from 'axios';
import {useState} from 'react';

function FightItem(props) {

  const [selectedOptionRed, setSelectedOptionRed] = useState(null);
  const [selectedOptionBlue, setSelectedOptionBlue] = useState(null);

  let url;
  if(props.blueCornerFighter === null) {
    url = "fighters/1"
  } else {
    url = "fighters/" + props.blueCornerFighter
  }

  axios({
    method: 'get',
    url: url
  }).then(response => {
    console.log(response.data)
  })

  
  return (
    <li className={classes.item}>
      <Card>
        <div className={classes.content}>
          <h3>{props.redCornerFighter},{props.blueCornerFighter}</h3>
        </div>
      </Card>
    </li>
  );
}

export default FightItem;
